import React, { useState } from 'react'; // import 로 useState 를 불러온다!
import styled from 'styled-components';
const MainSection = styled.section`
    margin: 0 16vw;
    padding:0px;

`; //ContentWarp 메인 css
const Ruleh2 = styled.h2`
    margin: 50px 0 27px;
`
const RuleDiv = styled.div`
    color: #3669c5;
    font-size: 24px;
    font-weight: 700;
    line-height: 27px;
`
const Ruledt = styled.dt`
    font-weight: 700;
    font-size: large;
    color:#666;
`
const Rdt = styled.dt`
    font-size: medium;
`
const Rule = () => {
 //ContentWarp 메인 css

  
    return(
        <MainSection>
            <main>
                <Ruleh2>
                    <RuleDiv>
                        대나무숲 규칙
                    </RuleDiv>
                    <dl>
                        <div>
                            <Ruledt>
                                제 1 장 총 칙
                            </Ruledt>
                            <br></br>
                            <dd>
                                <div>
                                    <Rdt>
                                        제 1 조 (목적)
                                    </Rdt>
                                    <Rdt>
                                        본 규칙은 부산경상대학교 (이하 BSKS라 칭함) 대나무숲 규칙으로, 대나무숲의 투명한 운영과 철저한 익명성 보장을 목적으로 합니다.
                                    </Rdt>
                                </div>
                            </dd>
                        </div>
                    </dl>
                </Ruleh2>

            </main>
        </MainSection>
    )

}

export default Rule;
